// import logo from './logo.svg';
import './App.css';
// import "./styles.css";
import React from "react";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";

const data = [
  {
    name: "San Francisco, CA",
    costOfLiving: 93.35,
    // pv: 2400,
    // amt: 2400
  },
  {
    name: "Austin, TX",
    costOfLiving: 63.04,
    pv: 1398,
    amt: 2210
  },
  {
    name: "Dallas, TX",
    costOfLiving: 64.80,
    pv: 9800,
    amt: 2290
  },
  {
    name: "Washington, DC",
    costOfLiving: 2780,
    pv: 3908,
    amt: 2000
  },
  {
    name: "Raleigh, NC",
    costOfLiving: 1890,
    pv: 4800,
    amt: 2181
  },
  {
    name: "San Jose, CA",
    costOfLiving: 2390,
    pv: 3800,
    amt: 2500
  },
  {
    name: "Charlotte, NC",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "Seattle, WA",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "Atlanta, GA",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "Huntsville, AL",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "Denver, CO",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "New York, NY",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    name: "Chicago, IL",
    costOfLiving: 3490,
    pv: 4300,
    amt: 2100
  }
];

export default function App() {
  return (
    <ResponsiveContainer width="100%" height={400}>
    <LineChart
      width={500}
      height={300}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5
      }}
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Line
        type="monotone"
        dataKey="pv"
        stroke="#8884d8"
        activeDot={{ r: 8 }}
      />
      <Line type="monotone" dataKey="costOfLiving" stroke="#82ca9d" />
    </LineChart>
    </ResponsiveContainer>
  );
}
